import React from "react";
import Form from 'react-bootstrap/Form'
import './pages.css';
import Button from 'react-bootstrap/Button';

const Review =() => {

    return (

        <div className="page">
            <Form>
                <Form.Group>
                   <Form.Select placeholder="Select movie">
                   <option value="1">One</option>
                   <option value="2">Two</option>
                   <option value="3">Three</option>
                   </Form.Select>
                </Form.Group>

                <Form.Group>
					<Form.Control className="input2" type="text" placeholder="Write your review here" />
				</Form.Group>

                <Button variant="primary" type="submit">
                    Submit Review
                </Button>
            </Form>
      </div>
    )
}

export default Review;
